var preserveProperties = function(properties, key, value) {
	properties[key] = value;
	return true;
};


gtfsRoutesWrapper = {
	routesCollection : {},
	routes : [],
	route_index  : 0,
	init:function(){
		gtfsRoutesWrapper.routesCollection.type = "FeatureCollection";
		gtfsRoutesWrapper.routesCollection.features = [];
	},
	getShape : function(){
		var sql = 'SELECT trips.shape_id as shape_id,trips.route_id as route_id,routes.route_short_name as route_name, count(shapes.shape_pt_sequence) as length FROM "njtransit_bus_07-12-2013".shapes,"njtransit_bus_07-12-2013".trips,"njtransit_bus_07-12-2013".routes where shapes.shape_id = trips.shape_id AND trips.route_id = routes.route_id AND routes.route_short_name = \''+ gtfsRoutesWrapper.routes[gtfsRoutesWrapper.route_index] +'\' group by trips.shape_id,trips.route_id,routes.route_short_name order by length desc limit 1';
		Gtfs.query(sql,{},function(err,shape_data){
			if (err) {res.send('{status:1"error",message:"'+err+'"}',500);return console.log(err);}
			shape_data.rows.forEach(function(shape){
				var routeFeature = {};
				routeFeature.type="Feature";
				routeFeature.properties = {};
				routeFeature.properties.route_short_name = shape.route_name;
				routeFeature.properties.route_id = shape.route_id;
				routeFeature.properties.shape_id = shape.shape_id;
				
				gtfsRoutesWrapper.routesCollection.features.push(routeFeature);
				gtfsRoutesWrapper.route_index += 1;
				loader.run();
			});
		});
	},
	getGeography : function(){
		
		var sql = 'SELECT shapes.shape_pt_lat, shapes.shape_pt_lon, shapes.shape_pt_sequence FROM "njtransit_bus_07-12-2013".shapes,"njtransit_bus_07-12-2013".trips,"njtransit_bus_07-12-2013".routes where shapes.shape_id = trips.shape_id AND trips.shape_id = \''+gtfsRoutesWrapper.routesCollection.features[gtfsRoutesWrapper.route_index-1].properties.shape_id+'\' and trips.route_id = routes.route_id group by shapes.shape_id ,shapes.shape_pt_sequence order by shapes.shape_id , shapes.shape_pt_sequence';

		Gtfs.query(sql,{},function(err,route_data){
			if (err) {res.send('{status:2"error",message:"'+err+'"}',500);return console.log(err);}
			var x = 0;
			var geometry = {};
			geometry.type = 'LineString';
			geometry.coordinates = [];
			route_data.rows.forEach(function(route){

				geometry.coordinates[x] = [];
				geometry.coordinates[x][0] = route['shape_pt_lon']*1.0;
				geometry.coordinates[x][1] = route['shape_pt_lat']*1.0;
				x+=1;
				
			});
			gtfsRoutesWrapper.routesCollection.features[gtfsRoutesWrapper.route_index-1].geometry = geometry;
			loader.run();
		});
	}
};

var loader = {
	queue: [],
	push: function(fn, scope, params) {
		this.queue.push(function(){ fn.apply(scope, params||[]); });
	},
	run: function() {
		if (this.queue.length) this.queue.shift().call();
	}
};

function arrayEquals (foo,bar){
	if(foo.length === bar.length){
		for(var i = 0;i < foo.length;i++){
			if(foo[i] !== bar[i]){
				return false;
			}
		}
		return true;
	}
	return false;
}